import React from "react";
import BootstrapNav from "./components/BootstrapNav";
import BootstrapJumbotron from "./components/BootstrapJumbotron"
import BootstrapCard from "./components/BootstrapCard"

function App() {
  return <>
    <BootstrapNav />
    <BootstrapJumbotron />
    <BootstrapCard />
  </>;
}

export default App;
